void cbWorker(dyn_string dp, dyn_anytype val){
    dyn_dyn_anytype dd_vals = sortData(val);  // convert values to dyn_dyn anytype
    dyn_dyn_string dd_dps  = sortData(dp);    // convert datapoints to dyn_dyn anytype

    for(int i=1; i&lt;=dynlen(dd_vals); i++){
      // Mass flow
      sdShowValue(&quot;txt&quot;+i+&quot;_flow_m&quot;, dd_dps[i][1], dd_vals[i][1], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu&quot;+i+&quot;_flow_m&quot;, &quot;text&quot;, dpGetUnit(dd_dps[i][1]));
      // Pressure
      sdShowValue(&quot;txt&quot;+i+&quot;_press&quot;, dd_dps[i][2], dd_vals[i][2], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu&quot;+i+&quot;_press&quot;, &quot;text&quot;, dpGetUnit(dd_dps[i][2]));
      // Temperature
      sdShowValue(&quot;txt&quot;+i+&quot;_temp&quot;, dd_dps[i][3], dd_vals[i][3], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu&quot;+i+&quot;_temp&quot;, &quot;text&quot;, dpGetUnit(dd_dps[i][3]));
      // Average temp
      sdShowValue(&quot;txt&quot;+i+&quot;_atemp&quot;, dd_dps[i][4], dd_vals[i][4], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu&quot;+i+&quot;_atemp&quot;, &quot;text&quot;, dpGetUnit(dd_dps[i][4]));
      // Average temp
      sdShowValue(&quot;txt&quot;+i+&quot;_dens&quot;, dd_dps[i][5], dd_vals[i][5], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu&quot;+i+&quot;_dens&quot;, &quot;text&quot;, dpGetUnit(dd_dps[i][5]));
      // Average temp
      sdShowValue(&quot;txt&quot;+i+&quot;_adens&quot;, dd_dps[i][6], dd_vals[i][6], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu&quot;+i+&quot;_adens&quot;, &quot;text&quot;, dpGetUnit(dd_dps[i][6]));
      // Total volume
      sdShowValue(&quot;txt&quot;+i+&quot;_vol&quot;, dd_dps[i][7], dd_vals[i][7], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu&quot;+i+&quot;_vol&quot;, &quot;text&quot;, dpGetUnit(dd_dps[i][7]));
      // Total mass
      sdShowValue(&quot;txt&quot;+i+&quot;_mass&quot;, dd_dps[i][8], dd_vals[i][8], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu&quot;+i+&quot;_mass&quot;, &quot;text&quot;, dpGetUnit(dd_dps[i][8]));
  }
}

